svg.script:
var dn = {

  num_faces: function(elem) {
    numTspan = elem.querySelector('#tspan_num_faces')
    console.log('a', numTspan)
    dNum = numTspan.textContent.split('d')[1]
    console.log('d', dNum)
    return parseInt(dNum)
  },

  menu: {
    'Roll': {
      eventName: 'die_roll',
      otherEvents: ['dblclick'],
      applicable: (dieNode) => { return true },
      handler: function(evt) {
        return dice.roll_handler(
          this,
          dn.num_faces(this),
          this.querySelector('#tspan_numeric_value')
        )
      },
    },
    'Turn Up': {
      eventName: 'die_turn_up',
      applicable: (dieNode) => { return true },
      uiLabel: (dieNode) => { 
        let dieMax = dn.num_faces(dieNode)
        let tspan = dieNode.querySelector('#tspan_numeric_value')
        let nextNum = (parseInt(tspan.textContent) % dieMax) + 1
        return 'Turn to ' + nextNum
      },
      handler: function(evt) {
        return dice.turn_handler(
          this,
          dn.num_faces(this),
          this.querySelector('#tspan_numeric_value')
        )
      },
    },
  },

  initialize: function(elem, prototype) {
    console.log('initializing with prototype', prototype)
    if (prototype) {
      facesTspan = elem.querySelector('#tspan_num_faces')
      protoFacesTspan = prototype.querySelector('#tspan_num_faces')
      facesTspan.textContent = protoFacesTspan.textContent

      showTspan = elem.querySelector('#tspan_numeric_value')
      protoShowTspan = prototype.querySelector('#tspan_numeric_value')
      showTspan.textContent = protoShowTspan.textContent
    }
  },

}
